drop database if exists dextragiario;
create database dextragiario;
use dextragiario;

#
# TABLE STRUCTURE FOR: artigo
#

DROP TABLE IF EXISTS `artigo`;

CREATE TABLE `artigo` (
  `id_artigo` int(11) NOT NULL AUTO_INCREMENT,
  `id_topico` int(11) DEFAULT NULL,
  `id_colaborador` int(11) DEFAULT NULL,
  `ds_artigo` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id_artigo`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: colaborador
#

DROP TABLE IF EXISTS `colaborador`;

CREATE TABLE `colaborador` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nm_colaborador` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `email_colaborador` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: topico
#

DROP TABLE IF EXISTS `topico`;

CREATE TABLE `topico` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ds_topico` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;


